import { ApiProperty } from "@nestjs/swagger";

export class CreateProductDto {
	@ApiProperty()
	name: string;

	@ApiProperty()
	description: string;

	@ApiProperty()
	price: number;

	@ApiProperty()
	stock: number;

	@ApiProperty({ required: false })
	imageUrl?: string;

	@ApiProperty({ required: false })
	discount?: number;

	@ApiProperty()
	categoryId: string;

	@ApiProperty()
	businessId: string;
}
